"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.geni.com/people/Juho-Williams/6000000035686980545<br />\n\"... Juho R\u00e4m\u00f6, age 20, departed from the port of Hanko aboard SS Arcturus of the Finland Steamship Company on 9 Oct 1912 for Hull, England. He continued the voyage aboard RMS California of the Anchor Line on 19 Oct 1912. Price of the ticket 45 dollars. Destination New York City.<br />\nAccording to the US WW II 1942 Draft Registrations he was living in Cadillac, MI and his employer was the Pennsylvania Railroad. ...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
