"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nL\u00e4hde netiss\u00e4:<br />\nhttps://juupajoki.fi/wp-content/uploads/2023/04/IV_Kopsamon_kulttuuriymparistoselvitys_uusi_2015_pieni.pdf<br />\n\"Maunula<br />\nMaunulan tila esiintyy ensimm\u00e4isen kerran maakirjoissa vuonna 1565. Tila on toinen Kopsamon kahdesta ensimm\u00e4isest\u00e4 tilasta. Koko kirkonkyl\u00e4 on saanut nimens\u00e4 talon ensimm\u00e4isen is\u00e4nn\u00e4n Erkki Kopsaman mukaan. Tilan p\u00e4\u00e4rakennus ja luhti ovat 1800-luvulta, peruskorjaus tehtiin vuonna 1964.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
