"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttp://www.sjostedt-suku.net/web/sivu.php?part=1&amp;id=530<br />\n\"Vesilahden 650-vuotisteoksessa sukulaisemme Seppo Suvanto tarkastelee pit\u00e4j\u00e4n er\u00e4maita keskiajalla. (Seppo Suvanto: Lisi\u00e4 Vesilahden er\u00e4historiaan. Teoksessa Vesilahti 1346-1996. Jyv\u00e4skyl\u00e4 1996.)<br />\nHeikkil\u00e4ll\u00e4 oli oma er\u00e4maa ainakin R\u00e4mingiss\u00e4 Ruovedell\u00e4 -- kirkonkyl\u00e4st\u00e4 Kuruun johtavan maantien varrella J\u00e4minginsel\u00e4n rannalla, Helvetinj\u00e4rven kansallispuiston tuntumassa. Kukonpohja Visuvedell\u00e4 saattoi taas olla Anian kyl\u00e4n yhteinen er\u00e4maa. Ruovedell\u00e4 on my\u00f6s Davidin saari -- nimi on ehk\u00e4 muisto Heikkil\u00e4n is\u00e4nnist\u00e4. Keskiajalla Ruoveden er\u00e4maiden turkis- ja kalasaaliit olivat tietenkin olleet t\u00e4rkeit\u00e4 Anian Heikkil\u00e4n taloudelle.<br />\nKustaa Vaasa otti pirkkalaisten er\u00e4maat asutukseen 1560, mutta yhteyksien s\u00e4ilymisest\u00e4 Ruovedelle kertoo se, ett\u00e4 Matti Matinpojan ja Kristiina Mikontytt\u00e4ren vanhimmasta tytt\u00e4rest\u00e4 Kaisasta tuli Ruoveden Kekkosen talon em\u00e4nt\u00e4 ja monien ruovetel\u00e4issukujen kanta\u00e4iti, kuten Jouko Vesikansa on osoittanut. (Jouko Vesikansa: Sj\u00f6stedtien varhaisvaiheita. Kurikka 1980.)\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
