"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://suku.genealogia.fi/archive/index.php/t-32444.html<br />\nKuhmoisten lukkari oli Tuomas Klein n. 1690, ja ennen h\u00e4nt\u00e4 lukkareina toimivat mm. Tapialan Lukkarin talon is\u00e4nn\u00e4t Tuomas 1600-luvun alkupuolella ja Heikki 1662 - 1663.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
