"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://suku.genealogia.fi/archive/index.php/t-32646.html<br />\n=<br />\nhttps://suku.genealogia.fi/showthread.php?t=32646&amp;page=4<br />\n08.02.15, 18:41 taunot<br />\n\"Petter Stolpen suvulle Vihdin Palaj\u00e4rvi kuulunut vuodesta 1646.<br />\nPetter Stolpen tytt\u00e4ren tytt\u00e4ren lasten kesken tilat jaettiin S\u00f6derg\u00e5rdiin (Pohjatalo) ja Norrg\u00e5rdiin (Meritalo)- Mihink\u00e4h\u00e4n asti samalla suvulla ollut? Omistajana 1800-luvulla maisteri Ernst Fredrik Albrecht, Suomen postilaitoksen p\u00e4\u00e4llikk\u00f6 (https://helda, helsinki.fi ...) Vesi- ja Ymp\u00e4rist\u00f6hall. julk.\n</p>\n<p>\nPetter Stolpen j\u00e4lkeen oli tytt\u00e4rens\u00e4 Elsa ja puoliso Eric Sparman. Heid\u00e4n yksi tytt\u00e4rist\u00e4\u00e4n on tn. Sophia Sparman haud. 1.6.1721 Akaa R\u00e4tt\u00f6is 50-vuotiaana eli s.n. 1671. Sophian puoliso Eric Forsberg. Akaan R\u00e4tt\u00f6ss\u00e4 haudataan 32-vuotiaana Eric Forsberg 8.5.1720.\n</p>\n<p>\nF\u00f6rra l\u00e4nsman och ryska commissarien Eric Forsberg, Henric M\u00e4xberg som var gift Forsbergs systersdotter Anna Skugge (Akaan ylim. k\u00e4r. 2.-4.12.1723). Henric Mexbergin toinen puoliso 1.7.1721 Akaa R\u00e4tt\u00f6is V\u00e4k\u00e4s oli siis Anna Skugge (s.n. 1696 Vihti ja haud. 8.3.1767 Lohja). Anna Skuggen vanhemmat Vihdin Haapkyl\u00e4ss\u00e4 1684-1714 olivat Johan Henricsson Skugge (k.1714 Vihti) ja M\u00e4rta Ericsdotter Forsberg (k.1733 Vihti). Anna Skuggella ja Henrik Mexbergill\u00e4 oli ainakin tyt\u00e4r Maria s. 26.4.1722 Akaa R\u00e4tt\u00f6is V\u00e4k\u00e4s.\n</p>\n<p>\nF\u00e4ltv\u00e4beln Henric Mexberg:in \u00e4iti oli Beata Henricsdotter Lilius (k.1705) ja vihitty jo 1649 Johan Maexmontan (yo.matr. Hki, Tyrv\u00e4\u00e4n k\u00e4r. 13.-14.7.1696 s.258).\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://suku.genealogia.fi/showpost.php?p=283912&amp;postcount=6<br />\n\"... Kirstin vanhemmat olivat Pihlajalahden Sepp\u00e4l\u00e4n Juho Yrj\u00f6npoika k.1692 ja Maria Juhontyt\u00e4r k.n. 1724. T\u00e4m\u00e4 k\u00e4y ilmi 1723 kes\u00e4k\u00e4r\u00e4jill\u00e4, kun Kirsti Juhontyt\u00e4r Tapialasta vaati perinn\u00f6njakoa veljelt\u00e4\u00e4n Yrj\u00f6 Juhonpojalta edesmenneiden vanhempiensa irtaimesta Pihlajalahden talosta...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
