"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://suku.genealogia.fi/showpost.php?p=223575&amp;postcount=4<br />\n\"... Didrik Persson oli tyypillinen ammattiratsumies, h\u00e4n aloitti palveluksensa Knut J\u00f6nssonin (Kurck) johtamassa hovilipustossa 1589 kahdella hevosella. Kun aikoinaan ker\u00e4sin tietoja ensimm\u00e4isist\u00e4 satakuntalaisista r\u00e4lssitt\u00f6mist\u00e4 ratsutalollisista, pidin mahdollisena, ett\u00e4 h\u00e4n oli yksi niist\u00e4 monista ruotsinmaalaisista ratsumiehist\u00e4, joita tuli Suomen ratsuv\u00e4keen Ven\u00e4j\u00e4n-sodan aikana. H\u00e4nell\u00e4 ei ollut mit\u00e4\u00e4n peritty\u00e4 omaisuutta Suomessa. H\u00e4nen vaimonsa Brita osti 1601, miehens\u00e4 ollessa sotaretkell\u00e4, Ikaalisten Kurkelan kyl\u00e4n kolme taloa, jotka oli 1596 l\u00e4\u00e4nitetty Didrik Perssonille ratsupalvelusta varten (H\u00e4meenkyr\u00f6n k\u00e4r\u00e4j\u00e4t 14.10.1601, KA 222a:113v).\n</p>\n<p>\nH\u00e4nen uransa oli samankaltainen kuin Karkun Rainion Hans J\u00f6nssonin, joka oli Ruotsista kotoisin p\u00e4\u00e4tellen siit\u00e4 ett\u00e4 h\u00e4nen ensimm\u00e4inen ratsupalvelijansa oli nimelt\u00e4\u00e4n M\u00e5ns Elofsson. Molemmat palvelivat hovilipustossa, hankkivat ratsupalveluksen kautta huomattavan maaomaisuuden Suomessa ja molemmat n\u00e4ytt\u00e4v\u00e4t avioituneen aatelistaustaisen suomalaisen naisen kanssa.\n</p>\n<p>\nDidrik Persson oli ainakin kolmesti naimisissa...\" Kirjoittaja: Henrik Impola\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://suku.genealogia.fi/archive/index.php/t-16049.html<br />\nNimimerkki Sanna B 27.11.2011:<br />\n\"Oriveden Kopsamon Maunulan is\u00e4nt\u00e4 1649-1663 oli Maunu Matinpoika, pso Kerttu Rusintyt\u00e4r:<br />\n1635-1654: https://astia.narc.fi/uusiastia/viewer/?fileId=5737283513&amp;aineistoId=3606960221<br />\n1655-1674: https://astia.narc.fi/uusiastia/viewer/?fileId=5737283762&amp;aineistoId=3606960600<br />\nMaunulla oli SAY:n mukaan ainakin pojat Tuomas (vmo Liisa), Esko (vmo Kaisa) ja Lauri sek\u00e4 tyt\u00e4r Maisa. Tuomas vaimoineen mainitaan Maunulassa 1655-1659. Esko oli talon is\u00e4nt\u00e4 is\u00e4ns\u00e4 j\u00e4lkeen.<br />\nMaunu Matinpojalla ei n\u00e4y ainakaan p\u00e4\u00e4llisin puolin olevan mit\u00e4\u00e4n yhteytt\u00e4 Maunulaa aiemmin is\u00e4nn\u00f6ineisiin henkil\u00f6ihin.<br />\nOliko Maunu Matinpoika kotoisin L\u00e4ngelm\u00e4en Ristij\u00e4rvelt\u00e4? Siell\u00e4 mainitaan poikana ja is\u00e4nt\u00e4n\u00e4 Maunu Matinpoika 1634-1648; vaimo 1634-1636 Lucretia Markun-/Martintr., 1638 Kerttu Sipintyt\u00e4r:<br />\n1634-1654: https://astia.narc.fi/uusiastia/viewer/?fileId=5706944926&amp;aineistoId=3614442035<br />\n...Olisiko siten Juho ja Tuomas Maununpoikien \u00e4iti tuo Lucretia ja Eskon \u00e4iti Kerttu Rusintyt\u00e4r? Kertulla olisi silloin v\u00e4\u00e4r\u00e4 patronyymi 1638 (SAY, ainoa kerta kun se Ristij\u00e4rvell\u00e4 mainitaan) ja v\u00e4\u00e4r\u00e4 etunimi k\u00e4r\u00e4jill\u00e4 1665 (Anna Kertun sijaan)...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://suku.genealogia.fi/archive/index.php/t-16049.html<br />\nOriveden Kopsamon Maunulan is\u00e4nt\u00e4 1649-1663 oli Maunu Matinpoika, pso Kerttu Rusintyt\u00e4r.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://suku.genealogia.fi/showthread.php?t=28501<br />\n\"Dirik eli todella vanhaksi, mutta mielest\u00e4ni kirjuriksi h\u00e4n joutui melkein pystymets\u00e4st\u00e4. Mielest\u00e4ni h\u00e4n oli niit\u00e4 teinej\u00e4, jotka m\u00e4\u00e4r\u00e4ttiin kirjurin teht\u00e4viin kesken koulunk\u00e4ynnin. Kaunis k\u00e4siala oli h\u00e4nen ehk\u00e4 ainoa suosituksensa teht\u00e4viin. Varsinainen kirjuri, Matts Viborg taisi j\u00e4tt\u00e4\u00e4 ty\u00f6t kesken ja vouti Mikko Klaunpoika kuoli kesken kaiken ja kokematon alikirjuri joutui odottamattomaan vastuuseen.\" Kirjoittaja: Liisa Rajala\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
