"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://orivesiennenvanhaan.wordpress.com/2020/03/02/mestauspaikkaa-etsimassa/<br />\nVanhan lehtileike:<br />\n\u201dNimimerkki Matkamies kysyy Oriveden vanhan mestauspaikan sijaintia.\n</p>\n<p>\nOriveden kyl\u00e4n vuosina 1778\u20131779 laaditun isojakokartan mukaan mestauspaikka sijaitsi jokseenkin tarkkaan Paltanvuoren ja Orihvuoren \u2013 nykyisen Kultavuoren \u2013 puoliv\u00e4liss\u00e4. Alue oli noin puolen tynnyrinalan laajuinen ja rajoittui it\u00e4puoleltaan tiehen, joka my\u00f6hemmin sai nimekseen Sukkavartaankuja.\n</p>\n<p>\nIsojaossa mestauspaikka, k\u00e4r\u00e4j\u00e4huonetontti, nimismiehen ja lukkarin tontit ym. j\u00e4tettiin yhteisiksi. Ne jaettiin v. 1840 Kirkonkyl\u00e4n talojen kesken, mutta kartalla tai selitelm\u00e4ss\u00e4 ei n\u00e4y merkint\u00f6j\u00e4 mestauspaikasta. L\u00e4hialuetta nimitettiin Teltinm\u00e4eksi ja siit\u00e4 lounaaseen Vaasan maantien varressa ollutta tonttia Teltinm\u00e4en tontiksi. Mahtaako Telti tarkoittaa telttaa vai lieneek\u00f6 sanalla yhteytt\u00e4 teili-, teilaus-, teloitusm\u00e4keen?\n</p>\n<p>\nYhteisten paikkojen jaossa mestauspaikan alue annettiin Paavolan eli Ruikan, K\u00f6ssin ja Mattilan taloille. Sittemmin n\u00e4ist\u00e4 taloista erotetut Pihlaja, J\u00e4rvist\u00f6 ja Heikkil\u00e4 -nimiset tilat ovat entisen mestauspaikan aluetta, osoite Oriveden opaskartalla Sukkavartaantie 8\u201316.\n</p>\n<p>\nAinakin yhdest\u00e4 teloituksesta tiedet\u00e4\u00e4n \u2013 kiitos papin, joka kirjasi harvinaisia tapahtumia Oriveden seurakunnassa. Vuodelta 1761 h\u00e4n merkitsi muistiin: Martti Martinpoika Porvolasta mestattiin (ly\u00f6m\u00e4ll\u00e4 kaula poikki) ja teilattiin (asettamalla surmattu teilauspy\u00f6r\u00e4\u00e4n kaiken kansan n\u00e4ht\u00e4v\u00e4ksi) vaimon murhasta. (M\u00e5rten M\u00e5rtenson fr. Borgerla halsh\u00f6ggs och steglades f\u00f6r hustmord.) Asiaan kuuluva py\u00f6velinty\u00f6 tapahtui ilmeisesti Oriveden mestauspaikalla.\n</p>\n<p>\nNukkukaa rauhassa Te jotka koitte onnettoman lopun mestauspaikalla \u2013 ja Te jotka asutte saman paikan p\u00e4\u00e4ll\u00e4. Toivoo A.L.\" [Kirjoittaja A.L. lienee Antti Lehtonen (1934\u20132008), joka oli mm. DI, maaoikeusinsin\u00f6\u00f6ri ja sukututkija, julkaisi paljon tietoa Oriveden historiasta. Vanhan lehtileikkeen alkuper\u00e4 ja p\u00e4iv\u00e4ys eiv\u00e4t ole tiedossa, mutta luultavasti kyseess\u00e4 on Oriveden Sanomat.]\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
