"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nHuittisten hautausmaalla on Maria, Heikki ja Aino J\u00e4ppisen hautakivi<br />\nhttps://sukuhaku.genealogia.fi/default.asp?op=Grave&amp;id=395996 / Viitattu 27.7.2022<br />\nkuten my\u00f6s Marian siskon Elina J\u00e4ppisen ja h\u00e4nen l\u00e4heistens\u00e4 hautakivi ja Marian ja Heikin pojan Henrik J\u00e4ppisen hautakivi.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
