"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttp://www.metsapirtti.net/suvut/immonen/MikkoImmonen-1930.html<br />\n\"Mikko Immosen j\u00e4lkipolvi 1930-luvulla<br />\nMikko Immonen (eli 1600-luvulla) ja vaimonsa Dorothea (s. 1600-luku, k. (haud) 18.10.1752 Sakkola Korhola) asuvat itsellisin\u00e4 Sakkolan Korholan kyl\u00e4ss\u00e4. Mikko Immosesta ei ole suoria l\u00e4hdetietoja. Dorothea on haudattu Korholassa lokakuussa 1752. Marketta asui ennen avioitumista (1738) Mets\u00e4pirtin kirkolla ja Samuel Jaamassa. Heid\u00e4t mainitaan Sakkolan rippikirjassa 1748. <br />\nSamuel muutti Jaamaan vaimonsa kuoleman j\u00e4lkeen. Mukana seurasi Antti-poika. <br />\nSamuelin ja Marketan j\u00e4lkipolvea asuu eri puolilla Mets\u00e4pirtin pit\u00e4j\u00e4\u00e4 1930-luvulla. <br />\nOheisessa kartassa on esitetty heid\u00e4n j\u00e4lkipolvensa edustajia 1930-luvulla. Kunkin talon kohdalla (klikkaa merkki\u00e4) on esitetty talon asukkaita 1930-luvulla.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
