"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPyh\u00e4j\u00e4rven Lill-Pyh\u00e4n alueen eli Filikyl\u00e4n, Watikkalan, Taubilan ja pohjoisen naapurikyl\u00e4n Valkeam\u00e4en asutusta selvitt\u00e4v\u00e4 artikkeli:<strong></strong><br />\n<strong></strong>\"... Vuonna 1696 Watikkalassa asui kolme Pohjalaista, Filikyl\u00e4ss\u00e4 Sarvi ja Konssa. Vuonna 1712 oli aivan uusia asukkaita: Filikyl\u00e4, siell\u00e4 luterilainen tila: Jugan Juganov (Johan Johanin Tihver\u00e4inen) 40, vaimo Anna Perteleva 30, poika Jugan \u00bd, naimaton tyt\u00e4r Lasteika (Skolastika) 10... Vuoden 1727 maakirjassa (Watikkala, Filikyl\u00e4/Talttaby / LillPyh\u00e4): Tuomas Matin Pikko, 1 aateri, kylv\u00f6 6 tynnyri\u00e4 peltoon ja 1 kaskeen, asukas Lauri Kovero, nuori mies (of\u00e4rdigkarl), Juho Juhon Tihver\u00e4inen, 2/3 aateria, 4,2 tynnyri\u00e4 peltoon, 1 kaskeen (pappilan prebende) Matti Simon Ili\u00e4inen, 3/16 aateria, yksi tynnyri peltoon... Vuonna 1774 Lill-Pyh\u00e4n alueella asui Tihver\u00e4isi\u00e4, Kotosia, Hutriaisia ja H\u00e4m\u00e4l\u00e4isi\u00e4. Kun Taubilan toimintaa voimakkaasti alettiin laajentaa 1820-luvulla, tyhjennettiin kyl\u00e4t laajenevien peltojen tielt\u00e4...\"<br />\nL\u00e4hde: Vpl Pyh\u00e4j\u00e4rvi lehti N:o 10 62. vuosikerta, 24.10.2017, sivu 8-9: Esko Simonen: Kyl\u00e4kierros, osa 1 Pyh\u00e4j\u00e4rven asutus vuosina 1500-1770 https://www.karjalanliitto.fi/media/jasenyhteisot/vpl.-pyhajarvi-saatio-hakanen-pertti/lehtiarkisto/2017/pj-2017-10.pdf / Viitattu 9.12.2023\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPyh\u00e4rven kunnanvaltuustossa istui samaan aikaan kaksi Juho Tomperia, r\u00e4\u00e4t\u00e4li Yl\u00e4j\u00e4rven kyl\u00e4st\u00e4 ja maanviljelij\u00e4 Jaaman kyl\u00e4st\u00e4:<br />\n\"Pyh\u00e4j\u00e4rvell\u00e4 valittiin v. 1918 kunnanvaltuustoon 24 j\u00e4sent\u00e4. T\u00e4h\u00e4n vuoden alusta 1919 toimintansa aloittaneeseen valtuustoon tulivat kuulumaan: mv. Esko Oranen, Konnitsa, kaupp. Mikko Lappalainen, Alakyl\u00e4, mv. Pekko Vanhanen, Yl\u00e4j\u00e4rvi, mv. Simo Kaasalainen, Pattoinen, kievarinhoitaja Juho Sirki\u00e4, Sortanlahti, opett. Matti Toiviainen, Salitsanranta, lautamies Tuomas Kaasalainen, Konnitsa, mv. Juho Pusa, Enkkua, mv. Simo Savolainen, Pyh\u00e4kyl\u00e4, v\u00e4nrikki Antti P\u00e4rssinen, Kunnianiemi, mv. Simo Naskali, Tolsterniemi, mv. Juho Herra, Kiimaj\u00e4rvi, mv. Tuomas Kitunen, Montrua, mv. Matti Nieminen, Salitsanranta, talonpoika Matti Viskari, Porsaanm\u00e4ki, mv. Juho P\u00e4iv\u00e4l\u00e4inen, Orola, r\u00e4\u00e4t\u00e4li Juho Tomperi, Yl\u00e4j\u00e4rvi, mv. Juho Tomperi, Jaama, mv. Tuomas Tp. Kukko, Tiitua, mv. Juho Uuksulainen, Larjava, mv. Antti P\u00e4rssinen, Puikkoinen, mv. Tuomas J\u00e4ppinen, Saapru, mv. Jooseppi Tikka, Lahnavalkama, tulliviskaali Gr\u00f6nberg, Sortanlahti.\"<br />\nL\u00e4hde: Vpl Pyh\u00e4j\u00e4rvi -lehti N:o 11 63. vuosikerta, 20.11.2018, sivu 6: Jatkoa Kaarle Wiikan kirjoitukseen L\u00e4pileikkaus Vpl. Pyh\u00e4j\u00e4rven kunnallishallinnosta, https://www.karjalanliitto.fi/media/jasenyhteisot/vpl.-pyhajarvi-saatio-hakanen-pertti/lehtiarkisto/2018/vpl-11-2018-marraskuu.pdf / Viitattu 13.11.2023\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPyh\u00e4j\u00e4rvi-lehden 2018-3 sivu 6 artikkelissa \"Kyl\u00e4kierros, osa II b: Orolan kyl\u00e4\" Esko Simonen kertoo Orolan 1600 ja 1700-lukujen Nokelaisista ja muista asukkaista:<br />\n\"Orolan kyl\u00e4n alue ulottui alkujaan koko niemen halki, kirkko ja pappilan maat erotettiin Orolasta 1600-luvun alkupuolella. Joissakin l\u00e4hteiss\u00e4 on mainittu my\u00f6s nimi Sep\u00e4nkyl\u00e4. Virallisissa dokumenteissa ei tuota nime\u00e4 ole k\u00e4ytetty, mutta luultavasti kyl\u00e4n asukkaista joku on sepp\u00e4 ollut.<br />\n   Nokelainen vai P\u00e4iv\u00e4l\u00e4inen, kumpi oli ensin Orolassa? Kysymykseen oikea vastaus on P\u00e4iv\u00e4l\u00e4inen, kuitenkin varhaisin kyl\u00e4\u00e4n kirjattu henkil\u00f6 oli Matti Kuoppa vuonna 1617... <br />\n   Vuonna 1683 Kuopan sukua ei en\u00e4\u00e4 ollut, tilalle oli tullut Heikki Nokelainen. Vuoden 1712 veroluettelossa olivat:<br />\n- luterilainen Jugan Genrikov 50 (Nokelainen), h\u00e4nell\u00e4 vaimo Pereta Hristeleva 40, kaksi poikaa Pedor 30, Geika 10 ja naimaton tyt\u00e4r Pereta 4. H\u00e4nell\u00e4 my\u00f6s kaksi velje\u00e4 Marka 25 ja Pedor 20.<br />\n- luterilainen Geika Geikiev 20 (P\u00e4iv\u00e4l\u00e4inen)...<br />\n1700-luvun henkikirjoissa on edelleen vain n\u00e4it\u00e4 kahta sukua. Vuonna 1727 molemmat kylv\u00e4v\u00e4t peltoon 2 tynnyri\u00e4 ja 8 kappaa sek\u00e4 kaskeen tynnyrillisen. Nokelaisen k\u00e4yt\u00f6ss\u00e4 oli viel\u00e4 Pattoisissa sijaitseva Hallikan autiotila yhdess\u00e4 Lahnavalkamalla asuvan P\u00f6ystin kanssa...\"<br />\nL\u00e4hde: https://www.karjalanliitto.fi/media/jasenyhteisot/vpl.-pyhajarvi-saatio-hakanen-pertti/lehtiarkisto/2018/vpl-3-2018-maaliskuu.pdf / Viitattu 10.11.2023<br />\n--<br />\nArtikkelista ei voi selv\u00e4sti tunnistaa t\u00e4h\u00e4n sukupuuhun kuuluvaa Petter Nokelaista, mutta saa k\u00e4sityksen ett\u00e4 vuoden 1724 v\u00e4est\u00f6luettelossa esiintyv\u00e4t veljekset *Simon, Petter ja Marcus Nokelainen voivat olla Jugan Genrikovin eli Johan Henrikinpoika Nokelaisen velji\u00e4, ja niin ollen heid\u00e4n is\u00e4ns\u00e4 nimi voi olla Heikki eli Henrik. My\u00f6s noin 1662 syntynytt\u00e4 ja 1770 Rotjanlahdessa kuollutta Elisabeth Henricsdotter Nokelaista voi sovitella samaan sisarusparveen, jolloin poikienkin \u00e4itiehdokkaaksi tulee Brita L\u00e4tti.<br />\nV\u00e4est\u00f6luettelossa 1724 voi olla vanhimmalla veljeksist\u00e4 v\u00e4\u00e4r\u00e4 nimi *Simon, ja maakirjassa 1728 oikea nimi Johan Hindersson tarkoittaen samaa henkil\u00f6\u00e4 kuin Jugan Genrikov eli Johan Henrikinpoika Nokelainen.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
