"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPyh\u00e4j\u00e4rvell\u00e4 asui monta Matti Kaasalaista 1500-luvun lopulla ja 1600-luvulla, mm. Matz Thomasinpoika Kaasoin Pyh\u00e4kyl\u00e4st\u00e4 ja Matz Staffaninpoika Kaasoin P\u00f6lh\u00f6l\u00e4st\u00e4.<br />\nL\u00e4hde: Vpl Pyh\u00e4j\u00e4rvi lehti N:o 9 51. vuosikerta 18.9.2006, sivu 1: Yrj\u00f6 J. Kaasalainen: Sukujen historiaa Pyh\u00e4j\u00e4rvell\u00e4 https://www.karjalanliitto.fi/media/jasenyhteisot/vpl.-pyhajarvi-saatio-hakanen-pertti/lehtiarkisto/2006/pj-2006-09.pdf / Viitattu 9.12.2023\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
