"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nYl\u00e4puolen komppania, H\u00e4meenlinnan l\u00e4\u00e4ni, Kangasala, komppanian n:o 16, Pahlila, Lintula\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nYl\u00e4puolen komppania, H\u00e4meenlinnan l\u00e4\u00e4ni, Kangasala, komppanian n:o 6, Vehkapuntari, Hinkala\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Tuomiokirjapoiminnat1366-1878.pdf<br />\nsivu 250: <br />\nOriveden syysk\u00e4r\u00e4j\u00e4t 12-13.9.1698<br />\n VA Yl\u00e4-Satakunta KOa18 s. 69-, mikrofilmi ES 1970<br />\ns. 70v - Cronobonden J\u00f6ran Hindersson i Sahrajerfwi bewilliades i brandstodh - -. Elden har af ugnen uthi ett p\u00f6rtte uthi w\u00e4ggen l\u00f6\u00f6skommit och till aska lagt n\u00e5gre huus och opsatt korn i ett p\u00f6rte.\"\n</p>\n<p>\nsivu 270:<br />\nOriveden ja Cuoreveden syysk\u00e4r\u00e4j\u00e4t 19.9.1704 Oriveden nimismiehentalossa<br />\n VA Yl\u00e4-Satakunta KOa24 s. 466-, mf ES 1973<br />\n\"s. 467v - J\u00f6ran Henrichsson ifr\u00e5n Sahrajerfwi wpwiste Crono Befallningzman Claes Detlofssons Inrymmelseskrift 3.8.1703 uthi Olofs Hemman i Borgarla by, som en Henrich Eskelsson tillf\u00f6rende \u00e5bodt, men 1700 m\u00e5st f\u00f6r dublerings Solldat utmarchera och hemmanet \u00f6de l\u00e4mna. Redog\u00f6relse f\u00f6r bygnader, Till skatte 1708.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Tuomiokirjapoiminnat1366-1878.pdf<br />\nSivu 252<br />\n\"Oriveden kes\u00e4k\u00e4r\u00e4j\u00e4t 19.5.1699 <br />\nVA Yl\u00e4-Satakunta KOa11 s. 802-, mf ES 1966<br />\n...<br />\ns. 807 - Lensm:n Henrich Ollenqvist ber\u00e4ttade, det kyrkioherden i L\u00e4ngelm\u00e4ki H:r Hinrich Luccander l\u00e5tit honom wetha, det h:n Anna Mattsdotter i Wilkil\u00e4 skohlat med 1 k\u00e5hlyxa skadat dess man framl. J\u00f6ran M\u00e5rthensson uthi h\u00f6gra handen, s\u00e5 att fara skulle wara till lijfwet. Annas syster Walborg Mattsdotter hade befunnit, det Anna f\u00f6rswarat sigh och hwadh hon giordt hade skedt of\u00f6rwarandes. F\u00f6lliande wittnen \u00e5h\u00f6rdes: smeden ifr\u00e5n Syfw\u00e4jerfwi Mats Philipsson, - - den aflednes broder Johan M\u00e5rthensson, - - coadjutoren H:r Johan Luccander. \u00c4nnu skall \u00e5h\u00f6ras enckians sw\u00e4rfaar och moder Walborgh Bertillsd\u00e5tter, dess sw\u00e4gerskor Kirstin och Anna M\u00e5rtensd\u00f6ttrar sampt enckians egen syster Walborg Mattsdotter, j\u00e4mbw\u00e4hl ock H:r J\u00f6ran H\u00e4rpman. Opsk\u00f6ts.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Tuomiokirjapoiminnat1366-1878.pdf<br />\nsivu 258:<br />\nOriveden syysk\u00e4r\u00e4j\u00e4t 23-24.9.1701 uti Oriwesiby Lendzmans g\u00e5rdh<br />\n VA Yl\u00e4-Satakunta KOa21 s. 73-, ES 1971<br />\n\"s. 75 - Enckian Agneta M\u00e5rtensd\u00e5tter med sin son Thomas Thomasson anh\u00f6llo, att hennes son J\u00f6ran Thomasson i Koifwuniemi m\u00e5tte l\u00e5ta upr\u00e4tta ett richtigt inventarium \u00f6fwer allan egendomen, som han omh\u00e4nder hafwer af sin sahl. faders, denne Agnetas mans Thomas Sigfredssons egendom, hwaraf Agneta kommer att taga 1/3 f\u00f6r sin giftor\u00e4tt och dhe \u00f6frige 2/3 faller samptelige barnen emellan f\u00f6r f\u00e4dernet till dehlnings.\"\n</p>\n<p>\nsivu 287:<br />\nOriveden ja Kuoreveden syysk\u00e4r\u00e4j\u00e4t 5.10.1708<br />\n VA Yl\u00e4-Satakunta KOa30 s. 514-, mikrofilmi ES 1976<br />\n\"s. 527 - Thomas Thomasson ifr\u00e5n Napila slagit Matz Anderssons dotter Walborg Matzdotter p\u00e5 \u00e4ngen, s\u00e5 att Walborg deraf warit swullen under w\u00e4nstra \u00f6rat. \"\n</p>\n<p>\nsivu 312:<br />\nOriveden ja Kuoreveden syysk\u00e4r\u00e4j\u00e4t 6. ja 8.10.1722 (uti H\u00e5llma g\u00e5rd)<br />\nVA Yl\u00e4-Satakunta KOa34 s. 561v-, mikrofilmi ES 1978<br />\n\"s. 568v - Thomas Thomasson ifr\u00e5n Napila k\u00e4rde till sin hustrus Lisa Jacobzdotters Brorson Mattz J\u00f6ranson i samma by, som besitter hans Sw\u00e4rfaders Skattehemman Treiski i samma by om des hustrus arf, - - hwarp\u00e5 Mattz f\u00f6reb\u00e4r uti Farfadrens lifztid - - f\u00f6rlikning. (Asiakirja tuhoutunut isonvihan aikana.) \"\n</p>\n<p>\nsivu 325:<br />\nOriveden ja Kuoreveden kes\u00e4k\u00e4r\u00e4j\u00e4t 15-16.5.1724 Oriveden kyl\u00e4ss\u00e4<br />\nVA Yl\u00e4-Satakunta KOa36 s. 195v-, mf ES 1979 <br />\n\"s. 200v - Aldenstund n\u00e4mbdem\u00e4nnerne J\u00f6ran Johansson i Pittk\u00e4j\u00e4rfwi, Hendrich Olofsson i P\u00e4rinautio och Mattz Mattsson ifr\u00e5n S\u00e4yn\u00e4joki intyga, att Thomas Thomasson ifr\u00e5n Napila under Ryska \u00f6fwerw\u00e4ldetz tid, en\u00e4r han inf\u00f6r Befallninggzman Jacob Callia twistat om en j\u00e4rnst\u00e5ng med sin hustrus Brorsson Mattz J\u00f6ransson i samma By, med Mattz bem:te j\u00e4rnst\u00e5ng ang\u00e5ende blifwit s\u00e5lunda f\u00f6rlikt, att densamma af dem lika till h\u00e4lften hwardera b\u00f6r nyttias. Matz beklagade, att han en s\u00e5dan f\u00f6rlikning intet f\u00e5r till godo niuta, d\u00e4rwid Thomas s\u00f6kt inw\u00e4nda, att Matz den till honom aldeles f\u00f6rs\u00e5lt, som p\u00e5 intet s\u00e4tt kunnat fulltygas. (Matti m\u00e4\u00e4r\u00e4ttiin maksamaan puolet rautakangen arvosta.)\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
