"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nS\u00e4\u00e4ksm\u00e4en komppania, H\u00e4meenlinnan l\u00e4\u00e4ni, Urjala, komppanian n:o 51: Laukela, Ky\u00f6ppi\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Tuomiokirjapoiminnat1366-1878.pdf<br />\nsivu 430:<br />\nOriveden ja Kuoreveden syysk\u00e4r\u00e4j\u00e4t 12-14.10.1741<br />\n uti Sochnens Tingzhuus i Orriwesi by<br />\n VA Yl\u00e4-Satakunta KOa56 s. 596, mf ES 1990<br />\ns. 604 # 12 - Ang\u00e5ende en liten fot bod, som Beata Johansdotters ifr\u00e5n Hirfwij\u00e4rfwi afledne Man J\u00f6ran Persson skall, then tiden han wistadt p\u00e5 Bertula Krono Hemman i K\u00e5psama by, therst\u00e4des upbygdt, f\u00f6rentes, at Hemmanets nuwarande \u00e5boen Krister Ersson betalar 6 Cappar spanm\u00e5l och 24 \u00f6re K:rmt f\u00f6r samma Bod.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Tuomiokirjapoiminnat1366-1878.pdf<br />\nsivu 445: <br />\nOriveden pit\u00e4j\u00e4n ja Er\u00e4j\u00e4rven kappelin syysk\u00e4r\u00e4j\u00e4t 14-17.11.1743<br />\n VA Yl\u00e4-Satakunta KOa60 s. 347-, mikrofilmi ES 1992 <br />\n\"s. 362v # 21 - Mats Matsson med sine 3 grannar ifr\u00e5n Kockila by tiltalte Erick Ericksson ifr\u00e5n Sahraj\u00e4rfwi, f\u00f6r thet han skal huggit och s\u00e5ldt samt skurit ett swidieland om 20 cappors uts\u00e4de i rootr\u00e5\u00e5g p\u00e5 Kockila utmarck. Erick tillstod s\u00e5 wara skiedt med dragoneh\u00e5llarens Johan Jonassons ifr\u00e5n Jaarla lof och minne. Johan Jonasson p\u00e5stod marcken wara Jaarla Rusth\u00e5ld enskildt tillh\u00f6rig med r\u00e5er och m\u00e4rcken. K\u00e4randerne p\u00e5minte, at Dragoneh\u00e5llarens r\u00e5bref af h\u00e4radh\u00f6fdingen Dettloffsson wid tingsbordet och af nuwarande capellanen Johan Utter wid thes egit bord 6 \u00e5hr sedan skal blifwit upl\u00e4st och skall inneh\u00e5lla, at W\u00e4ram\u00e4ndy och Luchtankiukansia skola wara the r\u00e5er, som skola skilja Kockila och Jaarla byar. Upsk\u00f6ts.\"\n</p>\n<p>\nsivu 457:<br />\nOriveden ja Kuoreveden syysk\u00e4r\u00e4j\u00e4t 28.9. - 1.10.1745<br />\n VA Yl\u00e4-Satakunta KOa62 s. 872v-, mf ES 1994<br />\n\"s. 884 # 10 - Kronob\u00f6nderne Mats Matsson Mickola, Johan Andersson Tarcka, Johan Matsson Berttula och J\u00f6ran Jacobsson Martila ifr\u00e5n Kockila klagade, at Anders J\u00f6ransson Hirfwijerfwi och Erick Ericksson och J\u00f6ran Ericksson Sahrajerfwi \u00f6fwerskridit skogsr\u00e5er W\u00e4r\u00e4m\u00e4ndy, Luhdan Kiukan suo, Murhasalon pyycki, Salckijoen sohu och Koifvuselk\u00e4. Enligt swaranderne \u00e4ro r\u00e5erna Mustajerfven suon saren Kallio, Mustajerfven sari, Lauttasuon ojan su och Tielefwon pyycki. Upsk\u00f6ts.\"\n</p>\n<p>\nsivu 459:<br />\nOriveden ja Kuoreveden syysk\u00e4r\u00e4j\u00e4t 28.9. - 1.10.1745<br />\n VA Yl\u00e4-Satakunta KOa62 s. 872v-, mf ES 1994<br />\n\"s. 903v # 24 - Erick Ericksson ifr\u00e5n Sahrajerfwi tiltalte thess halfbroder J\u00f6ran Ersson ang\u00e5ende 4 swin, som therigenom at han eij igenst\u00e4ngt sin grind, sluppit til skogz och ther blifwit af wargar ihi\u00e4l refne. \"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
