"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttp://www.sakkola.fi/suvannon-seutu/Suvannon%20Seutu%201992-7.pdf<br />\nP\u00e4\u00e4telmi\u00e4: Revonlahti (Revolax) oli pieni kyl\u00e4 Suvannon etel\u00e4puolella Sakkolan Ojaniemess\u00e4. Se sijoittui suunnilleen samalle paikalle kuin talo Ojaniemi 19, joka ennen sotia oli Heikki Naskalin omistuksessa.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
