"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\"P\u00e4lk\u00e4neen T\u00f6yr\u00e4niemen yksin\u00e4istalon nimi on jo et\u00e4\u00e4ntynyt melkoisesti *t\u00f6den -alusta, joka siihen kaikesta huolimatta k\u00e4tkeytyy. T\u00e4st\u00e4 nimest\u00e4 on asiakirjamuotoja aina 1500-luvulta l\u00e4htien, ja vanhimmat niist\u00e4 on luettava *Tu\u00f6denniemi: T\u00f6denemi 1544, T\u00f6\u00f6dhenemi 1565, T\u00f6deniemi 1584 (SAY), T\u00f6denniemi 1571 (Suomen hopeaveroluettelot 1571 III s. 86). 1600-luvulla nimi vaihtuu *T\u00f6idenniemeksi: T\u00f6ijdeniemi 1619, T\u00f6ydhenniemi 1634 (SAY). T\u00e4m\u00e4 kirjoitustraditio jatkuu aina t\u00e4h\u00e4n p\u00e4iv\u00e4\u00e4n saakka. Esim. vuosien 1736\u20141742 kirkon p\u00e4\u00e4kirjassa, joka on vanhin, talon nimi kirjoitetaan T\u00f6ydenniemi. Sen j\u00e4lkeiset p\u00e4\u00e4kirjan kirjoitustavat ovat: Teudeniemi 1744\u20141750, 1751 \u2014 1758, 1773\u20141777, 1779\u20141784, Teudenniemi 1759 \u2014 1764, 1766\u20141771, T\u00e4ydennjemi 1785\u20141790, 1792\u20141797, T\u00f6idennjemi 1798\u20141803, 1804\u20141809, T\u00f6yd\u00e4nnjemi ja T\u00f6ydenjemi rinnakkain 1810\u20141815, Teydennjemi 1816-1822 , 1823\u20141829, 1830\u20141836, Teydenjemi 1837\u2014 1843, T\u00e4ynennjemi 1845 \u2014 1851, T\u00e4ydenniemei 1852 \u2014 1858, 1859\u20141865, ja v:sta 1866 eteenp\u00e4in T\u00f6ydenniemi. \u2014 Hyv\u00e4 esimerkki kirjoitustradition voimasta on se, ett\u00e4 viel\u00e4 nytkin kirkonkirjassa on T\u00f6ydenniemi. T\u00f6ydenniemi on alunperin ollut T\u00f6idenniemi muodon kirjoitusasu, mutta se on j\u00e4\u00e4nyt vallitsevaksi senkin j\u00e4lkeen kun \u00f6i -diftongia ei en\u00e4\u00e4 merkitty \u00f6y:ll\u00e4. T\u00f6yr\u00e4niemi on aivan my\u00f6h\u00e4inen muodostus; sit\u00e4 ei tavata viel\u00e4 kirkonkirjoissakaan. Sen kehkeytyminen on voinut tapahtua vasta sen j\u00e4lkeen kun d \u00bb r -muutos tapahtui seudulla, ja t\u00e4m\u00e4 muutos taas on niin my\u00f6h\u00e4inen, ett\u00e4 viel\u00e4 nytkin T\u00f6yr\u00e4niemen seudun syntyper\u00e4iset vanhukset ovat l:n kannalla, vaikka keski- ja nuorempi polvi jo onkin siirtynyt r:n k\u00e4ytt\u00e4j\u00e4ksi. Nimiasu T\u00f6yr\u00e4niemi on kansanetymologinen sekaantuma t\u00f6yr\u00e4 -sanaan, mik\u00e4 sekaantuminen &lt;5 \u00bb r -muutoksen j\u00e4lkeen on helposti ymm\u00e4rrett\u00e4v\u00e4 \u2014 varsinkin kun talo sijaitsee m\u00e4ent\u00f6yr\u00e4\u00e4ll\u00e4.\" L\u00e4hde netiss\u00e4 https://journal.fi/virittaja/article/view/32581 / Viitattu 25.6.2024\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
