"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://kansallisbiografia.fi/paimenmuisto/henkilo/6<br />\n\"Abrahamus Axelii (K 1697)<br />\nAbraham Axelsson<br />\nS oletettavasti 1620-luvulla. V Keuruun ensimm\u00e4inen kirkkoherra (Palanderin suvun kantais\u00e4) Axelius (Axillus) Theodorici ja Scholastica Hindersdotter / Henriksdotter / Lastikka Heikintyt\u00e4r.\n</p>\n<p>\nYlioppilas (Satacundensis, Keuruensis) Turussa syyslukukausi 1642, mainitaan Turun akatemian konsistorin p\u00f6yt\u00e4kirjassa viel\u00e4 3.4.1650 er\u00e4\u00e4n velkomisjutun yhteydess\u00e4.\n</p>\n<p>\nKeuruun kappalainen ainakin vuodesta 1656, jolloin asui vaimoineen Suolahden talossa; Keuruun kirkkoherra 1687.\n</p>\n<p>\nVanhan Ruoveden is\u00e4nt\u00e4luetteloissa (Ilma Orkamo 1960) Suolahden kyl\u00e4n Suolahden talon (talot Suolahti ja H\u00e4kkinen, sittemmin Pekkala) is\u00e4nt\u00e4 vuodesta 1653 kuolemaansa asti ja my\u00f6s kamarikollegion p\u00e4\u00e4t\u00f6ksell\u00e4 17.9.1675 Keuruun kirkkoherranpappilaksi m\u00e4\u00e4r\u00e4tyn saman kyl\u00e4n Kangasmannilan talon is\u00e4nt\u00e4 vuodesta 1688 niin ik\u00e4\u00e4n kuolemaansa asti.\n</p>\n<p>\nK Keuruu 6.6.1697 (haudattiin 8.6.1697).\n</p>\n<p>\nP1 Gertrud / Kerttu N.N., mainitaan 1656\u20131666, K (haudattu) Keuruu 1666; <br />\nP2 Katarina / Kaarina N.N., mainitaan 1667\u20131674; <br />\nP3 Margareta / Reetta N.N., mainitaan 1678\u20131683, K (haudattu) Keuruu 1683; <br />\nP4 jo 1684 Katarina Johansdotter / Kaarina Juhontyt\u00e4r Humalainen h\u00e4nen 2. avioliitossaan, eli lesken\u00e4 viel\u00e4 1705, P4 V Kangasalla asunut kruununvouti Juhana Matinpoika / Johan Mattsson Humalainen ja Reeta Markuksentyt\u00e4r / Margareta Markusdotter. Kaarina Juhontyt\u00e4r em\u00e4nn\u00f6i is\u00e4nt\u00e4luettelon (Ilma Orkamo 1960) mukaan viel\u00e4 toisen kerran leskeksi j\u00e4\u00e4ty\u00e4\u00e4n Suolahden taloa Suolahden kyl\u00e4ss\u00e4 1697\u20131701 ja luovutettuaan 1702 talon is\u00e4nnyyden v\u00e4vylleen Matti Matinpojalle kuoli ja haudattiin Keuruulla vasta 1734 (Keuruun kirkkoherranpappilaksi m\u00e4\u00e4r\u00e4tyn Kangasmannilan talon is\u00e4nt\u00e4luettelossa h\u00e4net kuitenkin mainitaan haudatuksi jo 1698).\n</p>\n<p>\nKatarina Humalaisen P1 korpraali (kornetti?) Johan / Justus? Iwanowitz\n</p>\n<p>\nJulkaistu 19.1.2011.<br />\nV\u00e4\u00e4n\u00e4nen, Ky\u00f6sti: Abrahamus Axelii. Turun hiippakunnan paimenmuisto 1554\u20131721 -verkkojulkaisu. Studia Biographica 9. Helsinki: Suomalaisen Kirjallisuuden Seura, 2011\u2013 (viitattu 18.6.2022). Julkaisun pysyv\u00e4 tunniste URN:NBN:fi-fe201101191118; artikkelin pysyv\u00e4 tunniste https://urn.fi/urn:nbn:fi:sks-thp-000006<br />\n\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
